import logo from './logo.svg';
import './App.css';
const changeText=(event)=>{
  console.log(event.target)
  event.target.innerText=event.innerText+"被點了"
}
const Button=(num)=>{
  var output=[];
  for(let i=1;i<=num+1;++i)
    output.push(<button onClick={changeText}>第{i}個鍵</button>)
  return output;
}
function App() {
  return (
    <div className="App">
      {Button(10)}
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
